var DATETIME_PATTERN = /^(\d{4})-(\d{2})-(\d{2}) (\d{2}):(\d{2})$/;
var DATE_PATTERN = /^(\d{4})-(\d{2})-(\d{2})$/;
var DateMixin = {
    computed: {
        now: function () {
            var today = new Date();
            var dd = today.getDate();
            var mm = today.getMonth() + 1; //January is 0!
            var yyyy = today.getFullYear();
            if (dd < 10) dd = '0' + dd;
            if (mm < 10) mm = '0' + mm;
            return (yyyy + '-' + mm + '-' + dd);
        }
    },
    filters: {
        date: function (datetime) {
            if (DATETIME_PATTERN.test(datetime)) return datetime.split(" ")[0];
            return datetime;
        },
        time: function (datetime) {
            if (DATETIME_PATTERN.test(datetime)) return datetime.split(" ")[1];
            return datetime;
        },
        day: function (date) {
            if (!!date && DATE_PATTERN.test(date)) {
                var arr = date.split("-");
                if (arr.length === 3) return arr[2];
            }
            return "";
        },
        month: function (date) {
            if (!!date && DATE_PATTERN.test(date)) {
                var arr = date.split("-");
                if (arr.length === 3) {
                    var months = [
                        "Ene", "Feb", "Mar", "Abr", "May", "Jun",
                        "Jul", "Ago", "Sep", "Oct", "Nov", "Dic"
                    ];
                    return months[parseInt(arr[1], 10) - 1]
                }
            }
            return "";
        },
        year: function (date) {
            if (!!date && DATE_PATTERN.test(date)) {
                var arr = date.split("-");
                if (arr.length === 3) return arr[0];
            }
            return "";
        }
    },
    methods: {
        nowStr: function () {
            var date = new Date();
            var monthNames = [
                "Ene", "Feb", "Mar", "Abr", "May", "Jun",
                "Jul", "Ago", "Sep", "Oct", "Nov", "Dic"
            ];
            var day = date.getDate();
            var monthIndex = date.getMonth();
            var year = date.getFullYear();
            return day + ' de ' + monthNames[monthIndex] + ' de ' + year + ' ' +
                date.getHours() + ':' + date.getMinutes() + ':' + date.getSeconds();
        }
    }
};


var FormMixin = {

        methods: {
            buildParams: function (url, params) {
                return url + "?" + $.param(params);
            },

            b64toBlob: function (b64Data, contentType, sliceSize) {
                contentType = contentType || '';
                sliceSize = sliceSize || 512;

                var byteCharacters = atob(b64Data);
                var byteArrays = [];

                for (var offset = 0; offset < byteCharacters.length; offset += sliceSize) {
                    var slice = byteCharacters.slice(offset, offset + sliceSize);

                    var byteNumbers = new Array(slice.length);
                    for (var i = 0; i < slice.length; i++) {
                        byteNumbers[i] = slice.charCodeAt(i);
                    }

                    var byteArray = new Uint8Array(byteNumbers);

                    byteArrays.push(byteArray);
                }

                return new Blob(byteArrays, {type: contentType});
            },


            objToFormData: function (obj) {
                var formData = new FormData();
                _.forOwn(obj, function(value, key) {
                    formData.append(key, value);
                });
                return formData;
            },

            serializeForm: function (form) {
                var unindexed_array = $(form).serializeArray();
                var indexed_array = {};
                $.map(unindexed_array, function (n, i) {
                    if (!!n['value'])
                        indexed_array[n['name']] = n['value'];
                });
                return indexed_array;
            }
        }
    }
